sys_variable_value.value:
(function execute(inputs, outputs) {

  var response = JSON.parse(inputs.responseJSON);

  if(response.errors) {
    throw "Failed query: " + response.errors[0].message;
  }

  else if(response.data) {
    if(!response.data.repository.refs) {
     throw "Failed to find branchs within the repository.";
    }
    outputs.repo_name = response.data.repository.name;
    outputs.repo_url = response.data.repository.url;
    outputs.repo_id = response.data.repository.id;

    var refList = [];
    var nodes = response.data.repository.refs.nodes;
    for(var i=0; i<nodes.length;i++) {
		var node = nodes[i];
      	var ref = {
        	name: node.name,
          	commit_url: node.target.commitUrl,
          	commit_date: new GlideDateTime(node.target.committedDate.replace("T", " ").replace("Z", "")).getValue(),
          	commit_message: node.target.message,
        };
      	refList.push(ref);
    }
    outputs.Branches = refList;
    outputs.branches = refList;
  }

})(inputs, outputs);

